import "./App.css";
import React from "react";
import Header from "./components/Header";
import Feature from "./components/Feature";
import Contact from "./components/Contact";
import NavBar from "./components/NavBar";

function App() {
  return (
    <main className="App">
      <NavBar/>
      <Header />
      <Feature />
      <Contact />
    </main>
  );
}

export default App;
